{
  "ubx_message": {
    "name": "UBX-MON-SYS",
    "class_id": "0x0a",
    "message_id": "0x39",
    "message_type": "periodic_polled",
    "description": "Current system performance information",
    "payload_length": {
      "fixed": 24
    },
    "payload_fields": [
      {
        "byte_offset": 0,
        "data_type": "U1",
        "name": "msgVer",
        "description": "Message Version",
        "fixed_value": 1
      },
      {
        "byte_offset": 1,
        "data_type": "U1",
        "name": "bootType",
        "description": "Boot type of master chip",
        "values": {
          "0": "Unknown",
          "1": "Cold Start",
          "2": "Watchdog",
          "3": "Hardware reset",
          "4": "Hardware backup",
          "5": "Software backup",
          "6": "Software reset",
          "7": "VIO fail",
          "8": "VDD_X fail",
          "9": "VDD_RF fail",
          "10": "V_CORE_HIGH fail"
        }
      },
      {
        "byte_offset": 2,
        "data_type": "U1",
        "name": "cpuLoad",
        "description": "Highest actual load of realtime tasks of all CPUs",
        "unit": "%"
      },
      {
        "byte_offset": 3,
        "data_type": "U1",
        "name": "cpuLoadMax",
        "description": "Maximal CPU load value seen since last restart",
        "unit": "%"
      },
      {
        "byte_offset": 4,
        "data_type": "U1",
        "name": "memUsage",
        "description": "Highest actual dynamic memory usage of all CPUs",
        "unit": "%"
      },
      {
        "byte_offset": 5,
        "data_type": "U1",
        "name": "memUsageMax",
        "description": "Maximal dynamic memory usage seen since last restart",
        "unit": "%"
      },
      {
        "byte_offset": 6,
        "data_type": "U1",
        "name": "ioUsage",
        "description": "Highest actual IO bandwidth usage of all rx/tx interfaces",
        "unit": "%"
      },
      {
        "byte_offset": 7,
        "data_type": "U1",
        "name": "ioUsageMax",
        "description": "Maximal bandwidth usage of all rx/tx interfaces seen since last restart",
        "unit": "%"
      },
      {
        "byte_offset": 8,
        "data_type": "U4",
        "name": "runTime",
        "scale": "raw",
        "unit": "sec",
        "description": "Time since last restart"
      },
      {
        "byte_offset": 12,
        "data_type": "U2",
        "name": "noticeCount",
        "description": "Number of notices occured since last restart"
      },
      {
        "byte_offset": 14,
        "data_type": "U2",
        "name": "warnCount",
        "description": "Number of warnings occured since last restart"
      },
      {
        "byte_offset": 16,
        "data_type": "U2",
        "name": "errorCount",
        "description": "Number of errors occured since last restart"
      },
      {
        "byte_offset": 18,
        "data_type": "I1",
        "name": "tempValue",
        "unit": "C",
        "description": "Temperature value"
      },
      {
        "byte_offset": 19,
        "data_type": {
          "array_of": "U1",
          "count": 5
        },
        "name": "reserved0",
        "reserved": true
      }
    ]
  }
}
